import React, { Component } from 'react';
import './Palach.css';
import palach from '../assets/art/palach.jpg';
import ArtDisplay from '../Components/ArtDisplay';

const Text = <span>
 There is one place in my hometown where everybody had drank beer at some point in their lifetime and that place is called Palach.
 Palach is the oldest rock club in town, standing like a rock since 1969 and it bears the name of Jan Palach.
 If somebody asks me, who is Jan Palach? I would reply: That’s that Czech student that put himself on fire. 
 But he is so much more…Jan was 21years old Czech student who committed suicide by self-immolation 
 as the political protest against the end of the Prague Spring (invasion of Soviet Union on Czechoslovakia in 1969). 
 This is in memory of him. 
            </span>

class Palach extends Component {

  render() {
    return(
      <ArtDisplay title='Jan Palach' client='Personal Work' year='2018' technique='Mixed media' text={Text}>
        <img className="block-image mx-auto mb-5" src={palach} alt="Obruc-color" />
      </ArtDisplay>
    );
  }
}

export default Palach;
